import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <ul>
        <li>
          <div> Movie Name: Blue</div>
          <div> Movie Rating: 8</div>
          <div> Movie Release Date: 8</div>
        </li>
      </ul>
    </div>
  );
}

export default App;
